HQ promo music video. &quot;Pump Up the Jam&quot; is the opening track on Technotronic's album Pump Up the Jam: The Album. The song was a worldwide hit, reaching number two in the United Kingdom in 1989. The song was also a landmark release for the Belgian EBM- and New Beat-influenced house music. It was able to tackle the tough American market and became the first house song to break into mainstream. It reached number two on the Billboard Hot 100. The song was later certified triple platinum.

Technotronic is a Belgian studio-based music project formed by Jo Bogaert (A pseudonym of Thomas DeQuincey, born 1954, Aalst, Belgium) in 1988, who had already made his musical mark in the beginning of the 1980s as a part of a cover band and as a solo artist under various New beat projects, including The Acts of Madmen and Nux Nemo. Together with the actual vocalist Ya Kid K, he produced this hit single &quot;Pump Up the Jam&quot; which was originally an instrumental. An image for the act was later put together utilizing Congolese-born fashion model Felly Kilingi as its album/single cover art and supposed singer in this music video.
